import React from 'react';
import { Routes, Route } from 'react-router-dom';

import './App.css';

import HomePage from './pages/homepage/homepage.component';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route exact path='/'component={HomePage} />
          <Route path='/hats'component={HomePage} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
